// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Vesting {
    uint public slicePeriod;
    uint public cliff;
    uint public duration;
    uint public startTime;
    mapping(address => uint) public beneficiaries;
    mapping(address => uint) public noOfvestedTokens;
    address[] public beneficiariesList;
    address public owner;
    IERC20 public token;

    constructor(address _token) {
        token = IERC20(_token);
        owner = msg.sender;
    }

    function lockTokens(address _beneficiary, uint _lockedTokensCount, uint _slicePeriod, uint _duration, uint _cliff, uint _startTime) public {
        require(msg.sender == owner, "Only the owner can lock tokens");
        token.transferFrom(_beneficiary, address(this), _lockedTokensCount);
        slicePeriod = _slicePeriod;
        duration = _duration;
        cliff = _cliff;
        startTime = _startTime;
        beneficiaries[_beneficiary] = _lockedTokensCount;
        beneficiariesList.push(_beneficiary);
    }

    function getVestedTokens(address beneficiary) public view returns (uint256) {
        if (block.timestamp < startTime + cliff) {
            return 0;
        } else if (block.timestamp >= startTime + duration) {
            return beneficiaries[beneficiary] - noOfvestedTokens[beneficiary];
        } else {
            uint256 timeSinceStart = block.timestamp - startTime;
            uint256 totalVestingPeriods = duration / slicePeriod;
            uint256 vestingPeriod = timeSinceStart / slicePeriod;
            uint256 vestedTokens = beneficiaries[beneficiary] * vestingPeriod / totalVestingPeriods;
            return vestedTokens - noOfvestedTokens[beneficiary];
        }
    }

    function release(address beneficiary) public {
        require(msg.sender == owner, "Only the owner can release tokens");
        uint256 releasableTokens = getVestedTokens(beneficiary);
        require(releasableTokens > 0, "No tokens to release");
        noOfvestedTokens[beneficiary] += releasableTokens;
        require(token.transfer(beneficiary, releasableTokens), "Transfer failed");
    }
}

